/*!50003 CREATE DEFINER=`leonardo_tiindo`@`%.%.%.%` PROCEDURE `cuenta_socio`(IN ganancia FLOAT, IN saldo FLOAT, IN porcentaje_apostado VARCHAR(45), IN porcentaje_registrado FLOAT, IN valorMul FLOAT)
BEGIN
    DECLARE confirmar INT;
    DECLARE calcular FLOAT;
    DECLARE empresa_valor FLOAT;
    DECLARE empresa_restante FLOAT;
	
    SELECT POSITION('%' IN porcentaje_apostado) INTO confirmar;

    IF ganancia > 0 THEN
        IF confirmar > 0 THEN
                SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	        SET empresa_restante = ((saldo*valorMul)*(porcentaje_registrado/100));
	        UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = (empresa_restante + empresa_valor) WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';

	    ELSE
	        SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	        SET empresa_restante = ((valorMul)*(porcentaje_registrado/100));
                UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = (empresa_restante + empresa_valor) WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';

	    END IF;
    ELSE
        IF confirmar > 0 THEN
            SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	        SET calcular = (saldo*valorMul);
		UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = empresa_valor-calcular WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';

	    ELSE
	        SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
                UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = empresa_valor-valorMul WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	    END IF;
    END IF; 

	END */$$
