/*!50003 CREATE DEFINER=`leonardo_tiindo`@`%.%.%.%` PROCEDURE `repartir_dinero`(IN ganancia FLOAT, IN saldo FLOAT, IN porcentaje_apostado VARCHAR(45), IN porcentaje_registrado FLOAT, IN tipo INT, IN valorMul FLOAT)
BEGIN
    DECLARE montoInversion FLOAT;
    DECLARE contar INT;
    DECLARE nInversion INT;
    DECLARE finalizado INT DEFAULT FALSE;
    DECLARE division FLOAT;
    DECLARE confirmar INT;
    DECLARE calcular FLOAT;
    DECLARE calculo FLOAT;
    DECLARE porc FLOAT;
    DECLARE porcexganancia FLOAT;
    DECLARE fechaOpera INT;
    DECLARE estado INT;
    DECLARE hora INT;
    DECLARE horaactual INT;
    DECLARE empresa_valor FLOAT;
    DECLARE empresa_restante FLOAT;
    DECLARE listadoRepartir CURSOR FOR SELECT r_inversion_robot.id, r_inversion_robot.inversion FROM r_inversion_robot WHERE r_inversion_robot.consignado=1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET finalizado = TRUE;
   
    SELECT DAYOFWEEK(NOW()) INTO fechaOpera;
    SELECT HOUR(NOW()) INTO horaactual;
	
    SELECT POSITION('%' IN porcentaje_apostado) INTO confirmar;
    SELECT COUNT(*) INTO contar FROM r_inversion_robot WHERE r_inversion_robot.consignado=1;
    SELECT estrategia.porcentaje INTO division FROM estrategia WHERE estrategia.id = tipo;
   
    SELECT diasemana.estado INTO estado FROM diasemana WHERE diasemana.valor = fechaOpera AND diasemana.estrategia = tipo;
    SELECT diasemana.hora INTO hora FROM diasemana WHERE diasemana.valor = fechaOpera AND diasemana.estrategia = tipo;
        IF estado > 0 THEN
            IF horaactual < hora THEN
                OPEN listadoRepartir;
                recorriendoLista: LOOP
                FETCH listadoRepartir INTO nInversion, montoInversion;
                    IF contar > 0 THEN
                        IF ganancia = 0 THEN
                            LEAVE recorriendoLista;
                        END IF;
                        IF estado = 0 THEN
                            LEAVE recorriendoLista;
                        END IF;
                        IF ganancia > 0 THEN
                            IF confirmar > 0 THEN
                                SET calculo = (((montoInversion*valorMul)*(porcentaje_registrado/100))*division);
                                SET porcexganancia = calculo/montoInversion;
                                SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
                                UPDATE r_inversion_robot SET r_inversion_robot.inversion = calculo+montoInversion WHERE r_inversion_robot.id = nInversion AND r_inversion_robot.consignado=1;
		                        SET empresa_restante = (((montoInversion*valorMul)*(porcentaje_registrado/100))*(1-division));
		                        UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = (empresa_restante + empresa_valor) WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
