		                        SET porc = valorMul/saldo;
		                        SET calculo = (((montoInversion*porc)*(porcentaje_registrado/100))*division);
		                        SET porcexganancia = calculo/montoInversion;

					UPDATE r_inversion_robot SET r_inversion_robot.inversion = calculo+montoInversion WHERE r_inversion_robot.id = nInversion AND r_inversion_robot.consignado=1;

		                        SET empresa_restante = (((montoInversion*porc)*(porcentaje_registrado/100))*(1-division));
		                        UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = (empresa_restante + empresa_valor) WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
                                SET contar = contar-1;
	                        END IF;
                            IF contar = 0 THEN 
                                LEAVE recorriendoLista;
                            END IF;
                        ELSE
                            IF confirmar > 0 THEN
		                        SET calcular = (montoInversion*valorMul);
		                        SET porcexganancia = calcular/montoInversion;
                                UPDATE r_inversion_robot SET r_inversion_robot.inversion = montoInversion-calcular WHERE r_inversion_robot.id = nInversion AND r_inversion_robot.consignado=1;
                                SET contar = contar-1;
	                        ELSE
		                        SET porc = valorMul/saldo;
		                        SET calcular = (montoInversion*porc);
		                        SET porcexganancia = calcular/montoInversion;

                                UPDATE r_inversion_robot SET r_inversion_robot.inversion = montoInversion-calcular WHERE r_inversion_robot.id = nInversion AND r_inversion_robot.consignado=1;
                                SET contar = contar-1;
	                        END IF;
                            IF contar = 0 THEN 
                                LEAVE recorriendoLista;
                            END IF;
                        END IF;
                    ELSE 
                        LEAVE recorriendoLista;
                    END IF;
                END LOOP;
            ELSE
                IF ganancia > 0 THEN
                    IF confirmar > 0 THEN
                        SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	                    SET empresa_restante = ((empresa_valor*valorMul)*(porcentaje_registrado/100));
	                    UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = (empresa_restante + empresa_valor) WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	                ELSE
	                    SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	                    SET empresa_restante = ((empresa_valor+valorMul)*(porcentaje_registrado/100));
	                    UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = (empresa_restante + empresa_valor) WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	                END IF;
                ELSE
                    IF confirmar > 0 THEN
                        SELECT wallet_negocio.cuenta_socio INTO empresa_valor FROM wallet_negocio WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	                    SET calcular = (saldo*valorMul);
                        UPDATE wallet_negocio SET wallet_negocio.cuenta_socio = empresa_valor-calcular WHERE token = 'lXPNr7cGdBT3kzOV2qo6Jsg0C';
	                ELSE
